  [],\n\t\"revision_timestamp\": \"2015-05-06T21:08:36.205143\",\n\t\"name\": \"novel-reduced-order-in-time-models-for-problems-in-nonlinear-aeroelasticity-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Research is proposed for the development
  and implementation of state of the art, reduced order models for problems inrnnonlinear
  aeroelasticity. Highly efficient and accurate aeroelastic simulation tools will
  be constructed based upon thernmathematical formalism of optimal prediction theory
  and a novel implementation of a filtered harmonic balance solutionrnmethodology.
  The implications of the proposed work include orders of magnitude reduction in computational
  time, with minimalrnloss of accuracy, for time periodic problems in nonlinear aeroelasticity.
  The application of the proposed innovations spans thernrange of flight, from high-speed
  transport vehicles, to small-scale, flapping Micro-Air vehicles. Anticipated results
  include 1) thernimplementation of the proposed reduced order methodology into both
  a standard grid-based aeroelastic tool and a materialrnpoint method monolithic aeroelastic
  solver for the production of technology ready, multi-flow regime aeroelastic simulationrntools
  2) application of the proposed work to large-scale simulation and comparison with
  experiment and \"full-order\" aeroelasticrnsimulations and 3) advancement of the
  state of knowledge for nonlinear problems in aeroelasticity in both the subsonic,
  lowrnReynolds number regime and transonic high Reynolds number regime.\",\n\t\"license_title\":
